/* eslint no-unused-vars: 0 */
import { ifDefined } from "lit-html/directives/if-defined.js";
import { html, svg, repeat, classMap, styleMap, unsafeHTML, scopeTag } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';

const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<div class="ui5-avatar-group-root"><div class="ui5-avatar-group-items" @keyup="${context._onkeyup}" @keydown="${context._onkeydown}" @focusin="${context._onfocusin}" tabindex="${ifDefined(context._groupTabIndex)}" @click="${context._onClick}" @ui5-click="${ifDefined(context._onUI5Click)}" aria-label="${ifDefined(context._ariaLabelText)}" role="${ifDefined(context._role)}" aria-haspopup="${ifDefined(context._containerAriaHasPopup)}"><slot></slot>${ context._customOverflowButton ? block1(context) : block2(context) }</div></div>`; };
const block1 = (context) => { return html`<slot name="overflowButton"></slot>`; };
const block2 = (context) => { return html`<${scopeTag("ui5-button", tags, suffix)} ._buttonAccInfo="${ifDefined(context._overflowButtonAccInfo)}" aria-label="${ifDefined(context._overflowButtonAriaLabelText)}" ?hidden="${context._overflowBtnHidden}" ?non-interactive=${context._isGroup} class="${classMap(context.classes.overflowButton)}">${ifDefined(context._overflowButtonText)}</${scopeTag("ui5-button", tags, suffix)}>`; };


	return block0(context);
};

export default main;
